import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import { User, Mail, Phone, MapPin, Save, Camera } from "lucide-react";

const EditProfile = () => {
        const [formData, setFormData] = useState({ name: "", email: "", phone: "", address: "" });
        const [message, setMessage] = useState("");
        const navigate = useNavigate();

        useEffect(() => {
                const fetchUserProfile = async () => {
                        try {
                                const token = localStorage.getItem("userToken");
                                if (!token) return navigate("/login");

                                const { data } = await axios.get("http://localhost:5000/api/users/profile", {
                                        headers: { Authorization: `Bearer ${token}` },
                                });

                                setFormData({ name: data.name, email: data.email, phone: data.phone, address: data.address });
                        } catch (error) {
                                setMessage("❌ Failed to fetch user profile.");
                        }
                };
                fetchUserProfile();
        }, [navigate]);

        const handleChange = (e) => {
                setFormData({ ...formData, [e.target.name]: e.target.value });
        };

        const handleSubmit = async (e) => {
                e.preventDefault();
                try {
                        const token = localStorage.getItem("userToken");

                        await axios.put("http://localhost:5000/api/users/profile", formData, {
                                headers: { Authorization: `Bearer ${token}` },
                        });

                        setMessage("✅ Profile updated successfully!");

                        setTimeout(() => {
                                setMessage("");
                                navigate("/profile");
                        }, 1500);
                } catch (error) {
                        setMessage("❌ Failed to update profile.");
                }

                setTimeout(() => {
                        setMessage("");
                }, 3000);
        };

        return (
                <div className="flex justify-center items-center min-h-screen  bg-[#f7f3ee] px-6">
                        <div className="w-full max-w-lg bg-[#FAF5F0] shadow-2xl rounded-2xl p-8 relative">
                                {/* Profile Avatar */}
                                <div className="flex flex-col items-center mb-6">
                                        <div className="relative">
                                                <img
                                                        src="https://via.placeholder.com/100"
                                                        alt="Profile"
                                                        className="w-24 h-24 rounded-full border-4 border-[#D8B6A4] shadow-lg"
                                                />
                                                <button className="absolute bottom-0 right-0 bg-[#B88E8D] p-1 rounded-full text-white shadow-md hover:bg-[#A67D7C]">
                                                        <Camera className="w-5 h-5" />
                                                </button>
                                        </div>
                                        <h2 className="text-2xl font-semibold text-[#6B4E4D] mt-3">Edit Profile</h2>
                                        {message && <p className="text-center text-red-500 mt-2">{message}</p>}
                                </div>

                                {/* Form */}
                                <form onSubmit={handleSubmit} className="space-y-5">
                                        {/* Input Fields */}
                                        {[
                                                { name: "name", placeholder: "Full Name", icon: <User className="w-5 h-5 text-[#B88E8D]" /> },
                                                { name: "email", placeholder: "Email", icon: <Mail className="w-5 h-5 text-[#B88E8D]" /> },
                                                { name: "phone", placeholder: "Phone Number", icon: <Phone className="w-5 h-5 text-[#B88E8D]" /> },
                                                { name: "address", placeholder: "Address", icon: <MapPin className="w-5 h-5 text-[#B88E8D]" /> }
                                        ].map(({ name, placeholder, icon }) => (
                                                <div key={name} className="relative">
                                                        <div className="absolute inset-y-0 left-3 flex items-center">{icon}</div>
                                                        <input
                                                                className="w-full p-4 pl-12 border border-[#D8B6A4] bg-[#F9ECE3] rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-[#B88E8D]"
                                                                name={name}
                                                                placeholder={placeholder}
                                                                value={formData[name]}
                                                                onChange={handleChange}
                                                        />
                                                </div>
                                        ))}

                                        {/* Save Button */}
                                        <button type="submit" className="w-full flex items-center justify-center gap-2 bg-[#B88E8D] text-white py-2 rounded-lg shadow-md hover:bg-[#A67D7C] transition duration-200">
                                                <Save className="w-5 h-5" /> Save Changes
                                        </button>
                                </form>
                        </div>
                </div>
        );
};

export default EditProfile;
